# class containing all information on 1 spectrum
class Spectrum:
        def __init__(self, file_name, np_raw_mz, np_raw_int, np_regrid_int):
            self.file_name = file_name          # filename of the raw spectrum
            self.np_raw_mz = np_raw_mz          # MZ values of raw spectrum
            self.np_raw_int = np_raw_int        # intensities of raw spectrum
            self.np_regrid_mz = np_grid_mz[:]   # MZ values of regridded spectrum
            self.np_regrid_int = np_regrid_int  # intensities of regridded spectrum

        def regridder(self):
            int_spectrum = self.np_regrid_int

            for i, j in enumerate(self.np_regrid_mz):

                # upper point in the raw spectrum
                id_mz_upper = np.searchsorted(self.np_raw_mz, j, side='left')
                value_mz_upper = self.np_raw_mz[id_mz_upper]
                value_int_upper = self.np_raw_int[id_mz_upper]

                # lower point in the raw spectrum
                id_mz_lower = id_mz_upper - 1
                value_mz_lower = self.np_raw_mz[id_mz_lower]
                value_int_lower = self.np_raw_int[id_mz_lower]

                # calculated distances in between mz grid vs upper and lower point mz, and factor
                w1 = j - value_mz_lower
                w2 = value_mz_upper - j

                if w2 == 0:
                    wr2 = 1
                    wr1 = 0
                else:
                    wr2 = 1 / w2
                    wr1 = 1 / w1

                # calculate intensity mz_grid
                int_spectrum[i] = int((wr1 * value_int_lower + wr2 * value_int_upper) / (wr1 + wr2))
            return int_spectrum



def regrid_spectrum(spectrum):
    spectrum.np_regrid_int = spectrum.regridder()
    return spectrum

def save_regrid(output_dir,spectrum):
    name_of_regrid_file = 'ReGrid_' + spectrum.file_name
    path_regrid = join(output_dir, name_of_regrid_file)

    np.savetxt(
        path_regrid, np.c_[spectrum.np_regrid_mz, spectrum.np_regrid_int], fmt=['%.2f', '%i'], delimiter='\t',
        header='MZgrid Int', comments='')



# Main function to regrid spectra
def main(full_ms_dir, output_dir):
    # Read all the spectra
    files = [f for f in listdir(full_ms_dir) if isfile(join(full_ms_dir, f))]
    files.sort()
    spectra = np.array([])
    for file in files:
        # Parse raw spectrum file and store data in raw spectrum arrays
        mz_spectrum = np.array([])
        int_spectrum = np.array([])

        read_data = pd.read_table(path.join(full_ms_dir, file), sep=' ')
        mz_values = read_data[read_data.columns[0]].values
        int_values = read_data[read_data.columns[1]].values
        filename = path.basename(file)

        mz_spectrum = np.append(mz_spectrum, mz_values)
        int_spectrum = np.append(int_spectrum, int_values)
        int_grid_spectrum = np.zeros(np_grid_mz.shape)


        file = Spectrum(filename, mz_spectrum, int_spectrum, int_grid_spectrum)
        spectra = np.append(spectra, file)

    # Regrid the raw spectrum spectra to the grid
    p = multiprocessing.Pool()
    spectra = p.map(regrid_spectrum, spectra)
    p.close()
    p.join()


    # Save the regridded spectrum to a txt file
    p2 = multiprocessing.Pool()
    func = partial(save_regrid, output_dir)
    p2.map(func, spectra)
    p2.close()
    p2.join()





if __name__ == "__main__":
    parser = argparse.ArgumentParser()
    parser.add_argument("full_ms_dir", help="Folder containing raw MALDI-TOF MS spectra")
    parser.add_argument("output_dir", help="Folder were regridded spectra will be saved")
    args = parser.parse_args()

    main(args.full_ms_dir, args.output_dir)
